class App extends React.Component {
  render() {

    return (
      <div class="container-fluid">
        <div class="text-center">
          <h1>My calculator</h1>
        </div>
        <ChooseOperation></ChooseOperation>
        <div class="row">
          <div class="col-sm-5">
            <CalcBlock></CalcBlock>
          </div>
          <div class="col-sm-7">
            <CaclOut></CaclOut>
          </div>
        </div>
      </div>
    );
  }
}
export default App;
